package edu.cmu.scs.fluorite.commands.runtime;

import edu.cmu.scs.fluorite.commands.Delete;
import edu.cmu.scs.fluorite.commands.Insert;
import edu.cmu.scs.fluorite.commands.Replace;
import edu.cmu.scs.fluorite.model.RuntimeHistoryManager;

/**
 * @author YoungSeok Yoon
 *
 */
class Segment {
	
	private int mOffset;
	private int mLength;
	private String mText;
	
	private String mBelongsTo;

	/**
	 * Create a new segment.
	 * @param offset The offset of this segment.
	 * @param length The length of this segment.
	 * @param text The corresponding text for this segment.
	 * @param belongsTo The file path to which this segment belongs.
	 */
	public Segment(int offset, int length, String text, String belongsTo) {
		mOffset = offset;
		mLength = length;
		mText = text;
		
		mBelongsTo = belongsTo;
	}
	
	/**
	 * Create a new segment from an Insert object.
	 * @param insert The insert object.
	 * @return Newly created segment using the insert object.
	 */
	public static Segment createInitialSegmentFromInsert(Insert insert) {
		return new Segment(insert.getOffset(), insert.getLength(), insert.getText(),
				RuntimeHistoryManager.getInstance().getCurrentFile());
	}
	
	/**
	 * Create a new segment from a Delete object.
	 * @param delete The delete object.
	 * @return Newly created segment using the insert object.
	 */
	public static Segment createInitialSegmentFromDelete(Delete delete) {
		return new Segment(delete.getOffset(), delete.getLength(), delete.getText(),
				RuntimeHistoryManager.getInstance().getCurrentFile());
	}
	
	/**
	 * Create a new segment from a Replace object.
	 * @param replace The replace object.
	 * @return Newly created segment using the insert object.
	 */
	public static Segment createInitialSegmentFromReplace(Replace replace) {
		return new Segment(replace.getOffset(), replace.getLength(), replace.getInsertedText(),
				RuntimeHistoryManager.getInstance().getCurrentFile());
	}
	
	/**
	 * Getter for the offset value.
	 * @return The offset value.
	 */
	public int getOffset() {
		return mOffset;
	}
	
	/**
	 * Increment the offset value by the given amount.
	 * @param amount The amount used when incrementing the offset.
	 */
	public void incrementOffset(int amount) {
		mOffset += amount;
	}
	
	/**
	 * Decrement the offset value by the given amount.
	 * @param amount The amount used when decrementing the offset.
	 */
	public void decrementOffset(int amount) {
		if (mOffset - amount < 0) { 
			throw new IllegalArgumentException();
		}
		mOffset -= amount;
	}
	
	/**
	 * Getter for the length value.
	 * @return The length value.
	 */
	public int getLength() {
		return mLength;
	}
	
	private void setLength(int length) {
		mLength = length;
	}
	
	/**
	 * Getter for the text.
	 * @return The corresponding text represented by this segment.
	 */
	public String getText() {
		return mText;
	}
	
	private void setText(String text) {
		if (text == null) {
			throw new IllegalArgumentException();
		}
		
		mText = text;
	}
	
	/**
	 * Merge with the following segment. The following segment should be removed from the segment list manually.
	 * @param followingSegment Another segment directly following this segment.
	 * @return true if success, false if fail.
	 */
	public boolean mergeWithSegment(Segment followingSegment) {
		if (followingSegment == null) {
			return false;
		}
		
		if (followingSegment.getOffset() != getOffset() + getLength()) {
			return false;
		}
		
		setLength(getLength() + followingSegment.getLength());
		setText(getText() + followingSegment.getText());
		return true;
	}
}

