package edu.cmu.scs.fluorite.commands.runtime;

import java.util.Iterator;
import java.util.LinkedList;
import java.util.List;
import java.util.ListIterator;

import edu.cmu.scs.fluorite.commands.Insert;

/**
 * @author YoungSeok Yoon
 *
 */
public class RuntimeInsert extends BaseRuntimeDocumentChange {
	
	private LinkedList<Segment> mSegments;

	public RuntimeInsert(Insert insert) {
		super(insert);
	}
	
	@Override
	public Insert getOriginal() {
		return (Insert) (super.getOriginal());
	}
	
	@Override
	public void initializeSpecific() {
		mSegments = new LinkedList<Segment>();
		mSegments.addLast(Segment.createInitialSegmentFromInsert(getOriginal()));
	}

	@Override
	public void applyInsert(RuntimeInsert insert) {
		ListIterator<Segment> it = mSegments.listIterator();
		
		while (it.hasNext()) {
			Segment segment = it.next();
			
			List<Segment> newInsertSegments = insert.getSegments();
			if (newInsertSegments.size() != 1) {
				throw new IllegalArgumentException("new insert parameter doesn't have 1 segment.");
			}
			
			Segment newSegment = newInsertSegments.get(0);
			
			// The new insert segment is on the left of the segment.
			if (newSegment.getOffset() <= segment.getOffset()) {
				// push all the subsequent segments back.
				segment.incrementOffset( newSegment.getLength() );
				while (it.hasNext()) {
					it.next().incrementOffset( newSegment.getLength() );
				}
			}
			// The new insert segment is on the right of the segment.
			else if (newSegment.getOffset() >= segment.getEndOffset()) {
				// Do nothing here.
				// Because the subsequent segments might conflict with the new insert segment,
				// let the loop continue.
			}
			// There is a conflict!!
			else {
				// Split this segment and add a new sub segment right after the current one.
				Segment segmentToBeAdded = segment.subSegment(newSegment.getOffset());
				segmentToBeAdded.incrementOffset(newSegment.getLength());
				it.add(segmentToBeAdded);
				
				// Cut down the current segment.
				segment.cutDown(newSegment.getOffset(), segment.getEndOffset() - newSegment.getOffset());
				
				// Mark the new insert as a conflict.
				addConflict(insert);
			}
		}
	}

	@Override
	public void applyDelete(RuntimeDelete delete) {
		Segment deleteSegment = delete.getSegment();
		
		ListIterator<Segment> it = mSegments.listIterator();
		
		while (it.hasNext()) {
			Segment segment = it.next();
			
			// The delete happened on the left of the current segment.
			// |---------- delete ----------|
			//                                 | current segment |
			if (deleteSegment.getEndOffset() <= segment.getOffset()) {
				// decrement all the subsequent segments' offsets.
				segment.decrementOffset(deleteSegment.getLength());
				
				while (it.hasNext()) {
					it.next().decrementOffset(deleteSegment.getLength());
				}
			}
			// |---------- delete ----------|
			//                     | current segment |
			else if (deleteSegment.getOffset() <= segment.getOffset()
					&& segment.getOffset() < deleteSegment.getEndOffset()
					&& deleteSegment.getEndOffset() < segment.getEndOffset()) {
				// cut down the current segment, and pull all the subsequent segments.
				segment.cutDown(segment.getOffset(), deleteSegment.getEndOffset() - segment.getOffset());
				segment.setOffset(deleteSegment.getOffset());
				
				while (it.hasNext()) {
					it.next().decrementOffset(deleteSegment.getLength());
				}
			}
			// |---------- delete ----------|
			//       | current segment |
			else if (deleteSegment.getOffset() <= segment.getOffset()
					&& segment.getEndOffset() <= deleteSegment.getEndOffset()) {
				// simply remove the current segment and continue the iteration.
				it.remove();
			}
			//      |--- delete ---|
			// |     current segment     |
			else if (segment.getOffset() < deleteSegment.getOffset()
					&& deleteSegment.getEndOffset() < segment.getEndOffset()) {
				// cut down the current segment, and pull all the subsequent segments.
				segment.cutDown(deleteSegment.getOffset(), deleteSegment.getLength());
				
				while (it.hasNext()) {
					it.next().decrementOffset(deleteSegment.getLength());
				}
			}
			//              |---------- delete ----------|
			// |     current segment     |
			else if (segment.getOffset() < deleteSegment.getOffset()
					&& deleteSegment.getOffset() < segment.getEndOffset()
					&& segment.getEndOffset() <= deleteSegment.getEndOffset()) {
				// cut down the current segment, and continue to loop.
				segment.cutDown(delete, length)
			}
		}
	}

	@Override
	public void applyReplace(RuntimeReplace replace) {
		// TODO Auto-generated method stub
		
	}

	@Override
	public void applyTo(BaseRuntimeDocumentChange docChange) {
		docChange.applyInsert(this);
	}
	
	public List<Segment> getSegments() {
		return mSegments;
	}
	
