public interface Fee {

	public void bar(double x);

}

public class Foo implements Fee {

	protected int i = 0;
	protected double d = 0.0;

	public void incrementI(){
		i+=1;
	}

	public void incrementD(){
		d+=1;
	}

	public void showI(){
		System.out.println("ShowI in Foo");
		System.out.println(i);
	}

	public void showD(){
		System.out.println("ShowD in Foo");
		System.out.println(d);
	}

	public void baz(){
		System.out.println("In baz in Foo");
		bar(2);
	}

	@Override
	public void bar(double x) {
		d*=x;
	}


	public void bar(int x) {
		i*=x;
	}

}

public class Faa extends Foo {

	public int i = 0;

	public void incrementI(){
		i += 5;
	}

	public void incrementD(){
		d+= 5;
	}

	public void showI(){
		System.out.println("#####");
		super.showI();
		System.out.println("ShowI in Faa");
		System.out.println(i);
		System.out.println("#####");
	}

	public void showD(){
		System.out.println("#####");
		super.showD();
		System.out.println("ShowD in Faa");
		System.out.println(d);
		System.out.println("#####");
	}

	@Override
	public void bar(int x) {
		i -=x ;
	}

}


public class Main {

	public static void main(String[] args) {
		Foo a = new Foo();
		Foo b = new Faa();

		a.incrementI();
		a.incrementD();
		b.incrementI();
		b.incrementD();

		a.showI(); // 1
		a.showD(); // 2
		b.showI(); // 3
		b.showD(); // 4

		b.baz();
		b.showI(); //5

		Fee c = (Fee) a;
		int x = 3;
		c.bar(x);
		a = (Foo) c;

		a.showI(); //6

	}

}

