	 * Create a new segment from a Replace object.
	 * @param replace The replace object.
	 * @return Newly created segment using the insert object.
	 */
	public static Segment createInitialInsertSegmentFromReplace(Replace replace) {
		return new Segment(replace.getOffset(), replace.getInsertionLength(), replace.getInsertedText(),
				RuntimeHistoryManager.getInstance().getCurrentFile());
	}
	
	/**
	 * Getter for the offset value.
	 * @return The offset value.
	 */
	public int getOffset() {
		return mOffset;
	}
	
	/**
	 * Increment the offset value by the given amount.
	 * @param amount The amount used when incrementing the offset.
	 */
	public void incrementOffset(int amount) {
		mOffset += amount;
	}
	
	/**
	 * Decrement the offset value by the given amount.
	 * @param amount The amount used when decrementing the offset.
	 */
	public void decrementOffset(int amount) {
		if (mOffset - amount < 0) { 
			throw new IllegalArgumentException();
		}
		mOffset -= amount;
	}
	
	/**
	 * Set the offset as the given value.
	 * @param offset New offset to be used.
	 */
	public void setOffset(int offset) {
		if (offset < 0) {
			throw new IllegalArgumentException();
		}
		mOffset = offset;
	}
	
	/**
	 * Getter for the length value.
	 * @return The length value.
	 */
	public int getLength() {
		return mLength;
	}
	
	private void setLength(int length) {
		mLength = length;
	}
	
	/**
	 * Returns the end offset of this segment (exclusive.)
	 * @return offset + length value.
	 */
	public int getEndOffset() {
		return getOffset() + getLength();
	}
	
	/**
	 * Getter for the text.
	 * @return The corresponding text represented by this segment.
	 */
	public String getText() {
		return mText;
	}
	
	private void setText(String text) {
		if (text == null) {
			throw new IllegalArgumentException();
		}
		
		mText = text;
	}
	
	/**
	 * Getter for the belongsTo field.
	 * @return The file path to which this segment belongs.
	 */
	public String getBelongsTo() {
		return mBelongsTo;
	}
	
	/**
	 * Merge with the following segment. The following segment should be removed from the segment list manually.
	 * @param followingSegment Another segment directly following this segment.
	 * @return true if success, false if fail.
	 */
	public boolean mergeWithSegment(Segment followingSegment) {
		if (followingSegment == null) {
			return false;
		}
		
		if (followingSegment.getOffset() != getEndOffset()) {
			return false;
		}
		
		setLength(getLength() + followingSegment.getLength());
		setText(getText() + followingSegment.getText());
		return true;
	}
	
	/**
	 * Return a new segment which represents a sub-section of this segment.
	 * @param offset The absolute offset relative to the beginning of the file.
	 * @param length The length of the resulting sub segment.
	 * @return The new sub segment object.
	 */
	public Segment subSegment(int offset, int length) {
		if (offset < getOffset() || offset + length > getEndOffset()) {
			throw new IllegalArgumentException();
		}
		
		return new Segment(offset, length,
				getText().substring(offset - getOffset(), offset - getOffset() + length),
				getBelongsTo());
	}
	
	/**
	 * Return a new segment which represents a sub-section of this segment starting from the given offset.
	 * @param offset The absolute offset relative to the beginning of the file.
	 * @return The new sub segment object.
	 */
	public Segment subSegment(int offset) {
		if (offset < getOffset() || offset > getOffset()) {
			throw new IllegalArgumentException();
		}
		
		return subSegment(offset, getEndOffset() - offset);
	}
	
	/**
	 * Cut down the given sub segment, and make this segment smaller.
	 * Note that this method does not change the offset.
	 * @param offset The absolute offset relative to the beginning of the file.
	 * @param length The length of the resulting sub segment.
	 * @return true if succeeds, false if fails.
	 */
	public boolean cutDown(int offset, int length) {
		if (offset < getOffset() || offset + length > getEndOffset()) {
			throw new IllegalArgumentException();
		}
		
		setLength(getLength() - length);
		setText(getText().substring(0, offset - getOffset()) + getText() +
				getText().substring(offset - getOffset() + length));
		
		return true;
	}
	
	/**
	 * Cut down the given sub segment, and make this segment smaller.
	 * Note that this method does not change the offset.
	 * @param offset The absolute offset relative to the beginning of the file.
	 * @return true if succeeds, false if fails.
	 */
	public boolean cutDown(int offset) {
		if (offset < getOffset() || offset > getEndOffset()) {
			throw new IllegalArgumentException();
		}
		
		return cutDown(offset, getEndOffset() - offset);
	}
}

