public class TimelineViewPart extends ViewPart implements DocumentChangeListener, MouseListener, SelectionListener {
	
	private Graph mGraph;
	private List<GraphNode> mNodes;
	private GraphNode mLastNode;
	
	private Menu mContextMenu;
	private MenuItem mSelectiveUndoMenuItem;
	
	private String mProjectName;
	private String mFilePath;
	
	private final Color COLOR_INSERT;
	private final Color COLOR_DELETE;
	private final Color COLOR_REPLACE;
	
	public TimelineViewPart() {
		super();
		
		Display display = Display.getDefault();
		COLOR_INSERT = new Color(display, 150, 200, 150);
		COLOR_DELETE = new Color(display, 200, 150, 175);
		COLOR_REPLACE = new Color(display, 200, 150, 50);
	}

	@Override
	public void createPartControl(Composite parent) {
		mGraph = new NonMovableGraph(parent, SWT.NONE);
		mGraph.setNodeStyle(ZestStyles.NODES_NO_ANIMATION);
		mGraph.setLayoutAlgorithm(new HorizontalLayoutAlgorithm(), true);
		mGraph.addMouseListener(this);
		mGraph.addSelectionListener(this);
		
		mContextMenu = new Menu(parent.getShell(), SWT.POP_UP);
		mSelectiveUndoMenuItem = new MenuItem(mContextMenu, SWT.PUSH);
		mSelectiveUndoMenuItem.setText("Undo Selected Operations");
		updateEnabled();
		
		mGraph.setMenu(mContextMenu);
		
		mNodes = new ArrayList<GraphNode>();
		
		// Register to the EventRecorder.
		EventRecorder.getInstance().addDocumentChangeListener(this);
		
		updateCurrentFileInfo();
		updateGraph();
	}

	@Override
	public void dispose() {
		super.dispose();
		
		EventRecorder.getInstance().removeDocumentChangeListener(this);
	}

	@Override
	public void setFocus() {
		// TODO Auto-generated method stub

	}

	public void activeFileChanged(FileOpenCommand foc) {
		// TODO check if the compare editor is open.. then do nothing here!
		if (foc.getProjectName() != null && foc.getFilePath() != null) {
			updateCurrentFileInfo(foc);
			updateGraph();
		}
	}

	public void documentChanged(BaseDocumentChangeEvent docChange) {
		appendNode(docChange);
	}
	
	private void updateGraph() {
		List<ICommand> docChanges = EventRecorder.getInstance().getDocumentChangeCommands();
		
		clearGraph();
		
		// Add new nodes.
		boolean currentFile = false;
		for (ICommand docChange : docChanges) {
			if (docChange instanceof FileOpenCommand) {
				FileOpenCommand foc = (FileOpenCommand)docChange;
				
				// Only care about normal text files.
				if (foc.getProjectName() == null || foc.getFilePath() == null) {
					continue;
				}
				
				if (foc.getProjectName().equals(mProjectName) && foc.getFilePath().equals(mFilePath)) {
					currentFile = true;
				}
				else {
					currentFile = false;
				}
			}
			
			if (currentFile) {
				appendNode((BaseDocumentChangeEvent)docChange, false);
			}
			else {
				continue;
			}
		}
		
		mGraph.applyLayout();
	}

	private void clearGraph() {
		// Deselect everything (otherwise, an error may occur)
		mGraph.setSelection(null);
		
		// Dispose all the connections
		while (mGraph.getConnections().size() > 0) {
			((GraphConnection)mGraph.getConnections().get(0)).dispose();
		}
		
		// Dispose all the nodes
		for (GraphNode node : mNodes) {
			node.dispose();
		}
		
		mLastNode = null;
	}
	
	private void updateCurrentFileInfo() {
		IEditorPart editor = Utilities.getActiveEditor();
		
		if (editor != null) {
			IEditorInput input = editor.getEditorInput();
			if (input instanceof IFileEditorInput) {
				try {
					IFileEditorInput fileInput = (IFileEditorInput)input;
					IFile file = fileInput.getFile();
					IProject project = file.getProject();
					mProjectName = project.getName();
					mFilePath = fileInput.getFile().getLocation().toOSString();
				} catch (Exception e) {
					e.printStackTrace();
				}
			}
		}
	}
	
	private void updateCurrentFileInfo(FileOpenCommand foc) {
		mProjectName = foc.getProjectName();
		mFilePath = foc.getFilePath();
	}
	
	private void appendNode(BaseDocumentChangeEvent docChange) {
		appendNode(docChange, true);
	}
	
	private void appendNode(BaseDocumentChangeEvent docChange, boolean applyLayoutImmediately) {
		// Do not add the FileOpenCommands without snapshots.
		if (docChange instanceof FileOpenCommand && ((FileOpenCommand)docChange).getSnapshot() == null)
			return;
		
		GraphNode node = new GraphNode(mGraph, SWT.NONE, docChange.getClass().getSimpleName());
		node.setData(docChange);
		setColor(node);
		setTooltip(node);
		
		if (mLastNode != null) {
			new GraphConnection(mGraph, ZestStyles.CONNECTIONS_SOLID, mLastNode, node);
		}
		
		mNodes.add(node);
		mLastNode = node;
		
		if (applyLayoutImmediately) {
			mGraph.applyLayout();
		}
	}
	
	private void setColor(GraphNode node) {
		BaseDocumentChangeEvent docChange = (BaseDocumentChangeEvent)node.getData();
		if (docChange == null) return;

		if (docChange instanceof Insert) {
			node.setBackgroundColor(COLOR_INSERT);
		}
		else if (docChange instanceof Delete) {
			node.setBackgroundColor(COLOR_DELETE);
		}
		else if (docChange instanceof Replace) {
			node.setBackgroundColor(COLOR_REPLACE);
		}
	}
	
	private void setTooltip(GraphNode node) {
		BaseDocumentChangeEvent docChange = (BaseDocumentChangeEvent)node.getData();
		if (docChange == null) return;
		
		if (docChange instanceof Insert) {
			Insert insert = (Insert)docChange;
			IFigure tooltip = new Label(insert.getText());
			node.setTooltip(tooltip);
		}
		else if (docChange instanceof Delete) {
			Delete delete = (Delete)docChange;
			IFigure tooltip = new Label(delete.getText());
			node.setTooltip(tooltip);
		}
		else if (docChange instanceof Replace) {
			Replace replace = (Replace)docChange;
			String message = "-\n" + replace.getDeletedText() + "\n+\n" + replace.getInsertedText();
			IFigure tooltip = new Label(message);
			node.setTooltip(tooltip);
		}
	}

	public void mouseDoubleClick(MouseEvent e) {
		List selection = mGraph.getSelection();
		if (selection.size() != 1) {
			// Do nothing for now.
			return;
		}
		
		GraphNode selectedNode = (GraphNode)selection.get(0);
		launchCompareUI((BaseDocumentChangeEvent)selectedNode.getData());
	}

	public void mouseDown(MouseEvent e) {
		// TODO Auto-generated method stub
		
	}

	public void mouseUp(MouseEvent e) {
		// TODO Auto-generated method stub
		
	}
	
	private void launchCompareUI(BaseDocumentChangeEvent docChange) {
		IEditorPart activeEditor = Utilities.getActiveEditor();
		
		CompareInput input = new CompareInput(
				new HistoryCompareItem(
						"Old Version",
						activeEditor,
						docChange),
				new SimpleCompareItem(
						"Current Version",
						Utilities.getDocument(activeEditor).get(),
						true)
				);
		
		CompareUI.openCompareEditor(input);
		
		CompareInput.setLastCompareInput(input);
	}

	public void widgetDefaultSelected(SelectionEvent arg0) {
		// TODO Auto-generated method stub
		
	}

	public void widgetSelected(SelectionEvent arg0) {
		// Don't use arg0. Simply check if there are some selected nodes in the graph.
		updateEnabled();
	}

	private void updateEnabled() {
		mSelectiveUndoMenuItem.setEnabled( mGraph.getSelection().size() > 0 );
	}

}

