package edu.cmu.cs.cs214.rec05.invariants;

import java.util.Arrays;

/**
 * An example <code>AdjacencyMatrixGraph</code> implementation.
 * @author YoungSeok Yoon
 *
 */
public class AdjacencyMatrixGraph {
	
	private int maxVertices;
	private int currentSize;
	private boolean[][] adjacencyMatrix;
	private Vertex[] verticesArray;
	
	/**
	 * Constructor with the capacity.
	 * @param maxVertices The maximum number of vertices that can be stored in this graph.
	 */
	public AdjacencyMatrixGraph(int maxVertices) {
		this.maxVertices = maxVertices;
		this.currentSize = 0;
		this.adjacencyMatrix = new boolean[maxVertices][maxVertices];
		this.verticesArray = new Vertex[maxVertices];
	}
	
	/**
	 * Add the vertex to this graph.
	 * Exception handling code is omitted for brevity.
	 * @param v Vertex to be added. Should not be null.
	 * @return true if successfully added.
	 */
	public boolean addVertex(Vertex v) {
		this.verticesArray[this.currentSize++] = v;
		return true;
	}
	
	/**
	 * Add an edge connecting the two vertices.
	 * Exception handling code is omitted for brevity.
	 * @param v1 The first vertex. This should be in the graph.
	 * @param v2 The second vertex. This should be in the graph.
	 * @return true if successfully added.
	 */
	public boolean addEdge(Vertex v1, Vertex v2) {
		int v1Index = indexOf(v1);
		int v2Index = indexOf(v2);
		this.adjacencyMatrix[v1Index][v2Index] = true;
		this.adjacencyMatrix[v2Index][v1Index] = true;
		return true;
	}
	
	private int indexOf(Vertex v) {
		return Arrays.asList(this.verticesArray).indexOf(v);
	}

}

