package edu.cmu.cs.cs214.rec05.invariants;

/**
 * A <code>Rectangle</code> represented by left, top, right, and bottom. 
 * @author YoungSeok Yoon
 *
 */
public class Rectangle {
	
	private int left, top, right, bottom;
	
	public Rectangle(int left, int top, int right, int bottom) {
		this.left = left;
		this.top = top;
		this.right = right;
		this.bottom = bottom;
	}
	
	public Rectangle() {
		this(0, 0, 0, 0);
	}

	public int getLeft()				{ return this.left; }
	public void setLeft(int left)		{ this.left = left; }

	public int getTop()					{ return this.top; }
	public void setTop(int top)			{ this.top = top; }

	public int getRight()				{ return this.right; }
	public void setRight(int right)		{ this.right = right; }

	public int getBottom()				{ return this.bottom; }
	public void setBottom(int bottom)	{ this.bottom = bottom; }
}
